This morning George and I set off for our solitary but lovely morning  mooch around the Queen Mother's Park. There were no furry friends for Georgie but he still had a fabulous time, sniffing scents and smells. We walked through Canterbury Road Cemetery together which Gorgeous Georgie really enjoyed.  Alll in all a Fantastic Friday Morning Mooch - just half a  paw-ups due to a lack of furry friendsğŸ¾ 

Then at 11.15 Super Scrappy came over for a playdate for half an hour and met luscious Lulu.  He really enjoyed her company. He met his friend Georgie again and they played a sort of doggie tag while Lulu looked on. George Scrappy and I headed down to the Warren for a lovely walkie which both doggies thoroughly enjoyed (more tag) but again met no other furry friends.  I think they would definitely give it half a paws up just for the tag.  I then dropped the Super Scrappy home after his Wonderful Warren WanderğŸ¾

Luscious Lulu's morning and lunchtime in the meantime was much more sedate, having a glorious garden gentle stroll, then a litle nap nap followed by barking at the henry hoover and mop before heading back to sleep after.lots of fussing. 

Mid-afternoon I took luscious Lulu out for her mini walkie wander with Georgie but Lulu was in no mood for a stroll.  She refused point blank to move so after we headed home where she had a quick glorious  garden moochie before heading back to a sleep in her favourite spot.. 

So a fantastic day and all the credit has to go to, Super Scrappy, Gorgeous Georgie and Luscious Lulu!  They have all been wonderful today! 
